From New Sensations, the studio that brought you &quot;The Big Lebowski: A XXX Parody&quot; and &quot;Reno 911: A XXX Parody,&quot; comes a pitch perfect sequel to one of the most successful parodies of all time in &quot;Seinfeld 2: A XXX PARODY!&quot; After a series of personal mishaps, the gang decides to place a bet on who can go the longest without having sex. In this hilarious sequel to the best selling original parody, Krammer, Gorge, Elaina and Gerry do their utmost to outlast each other in this contest of celibacy. Who will falter first? Who will be the last to succumb to their carnal desires? Can the woman outlast the men? We know you can't wait to find out, so come and join us for all the silly, crazy, and erotic fun! All of your favorite characters are parodied including Gerry, Elaina, Gorge, Krammer, and more in &quot;SEINFELD 2: A XXX PARODY.&quot; Featuring an All-Star cast including James Deen, Kristina Rose, Eric John, Ann Marie Rios, Gracie Glam, Nika Noir, and Asa Akira.

